cumulative.detail:
Bestäm funktionens logiska värde.

Om kumulativ är TRUE(), returnerar HYPGEOM.DIST den kumulativa fördelningsfunktionen;

Om FALSE(), returnerar den sannolikhetstäthetsfunktionen.
